import React from 'react';
import FriendsItem from './FriendsItem/FriendsItem';
import s from './Friends.module.css';


const Friends = (props) => {

    let friendsItems = props.sidebarPage.friends.map((n, i) => {
        return <FriendsItem name={n.name} key={i} />
    })

     return (
        <div className={s.friends}>
            <h3 className={s.title}>{props.sidebarPage.title.name}</h3>
            <ul className={s.list}>
                {friendsItems}
            </ul>
        </div>
    )
}

export default Friends;
